import { render } from 'react-dom';
import CardContainer from './CardContainer/CardContainer';
import CitySearch from './CitySearch/CitySearch';


let city="austin"


const cityUrl = `http://api.openweathermap.org/data/2.5/weather?q=houston&units=imperial&appid=51e464ca4cdfb256e268caccccef8edf`

class Home extends React.Component {

  state={
      weather:[]
  }




    componentDidMount=()=>{


          fetch(cityUrl)
          .then(response => response.json())
          .then(data=> this.setState({weather:data})

          )




    }



  render() {
    return (
      <div>
          <h1>Welcome Home:</h1>
          <CitySearch weather={this.state}/>
      </div>
    );
  }
}
export default Home
